import React, { Component } from 'react';
import MultiseriesChart from './Multiseries Chart'

const styles={
    backgroundColor: 'red',
    width: '70vw',
    height: '70vh'
}

class Container extends React.Component {
    render() {
        return(
            <div className="thecontainer" style={styles}>
                <MultiseriesChart />
            </div>
        )
    }
}

export default Container;
